import React, { useState, useEffect } from 'react';

const Card = () => {

    const [states, setStates] = React.useState([]);

    const [statelist, setstatelist] = React.useState([]);
    

    const getStates = async () => {

        let url = "https://api.data.gov.in/resource/463d908b-c03b-47d3-b5bb-33d584d27f65?api-key=579b464db66ec23bdd000001cdd3946e44ce4aad7209ff7b23ac571b&format=json";
        let data = await fetch(url);
        let temp = await data.json();
        // setStates(temp);

        console.log("data", temp);
        // setstatelist(states.records);
        sl = temp.records;
        console.log("statelist", sl);
    }


    useEffect(() => {
        getStates();
    }, []);

    return (
        <div className="row">
            {sl.map((element, index) => {
                // return 
                <div className=" col-sm-12 col-md-6 col-lg-4"
                    key={index}>
                    <div>
                        {element.category}
                        {/* {element.india_state_union_territory}
                        {element.population_2011}
                        {element.decadal_population_growth_rate___2001_2011}
                        {element.population_density_per_sq_km___2011} */}

                    </div>
                </div>
            })}
        </div>
    )

}

export default Card;
